LITTLE NIGHTMARES III

I’m a little behind but I just caught the Little Nightmares III trailer. I’ve been waiting for this moment for a while now! I honestly thought they wouldn’t make another but here we are. Looks like they have retired Six for now. It looks creepy as ever! Not sure on the new characters but it seems like it will be a Co-op style game… Either way I’m looking forward to playing it, and the CE looks awesome!

