RE4

It’s been a really long time since I treated myself to a game I wanted. This one has been on the list since launch day. Can’t wait to play! 

@residentevil @re_games @residentevil.germany #residentevil #residentevil4 #residentevil4remake #ps5 #playstation5

RESIDENT EVIL 4

Really happy to hear that RE4 won PS GOTY last night. I’m nearly finished my play through and I have legit been spooked a couple of times. It’s a fantastic remake. 

@capcom_europe @re_games #residentevil #residentevil4 #residentevil4remake #ps2 #playstation2

RESIDENT EVIL 4 

Last night I finished the RE4 remake for the first time. It was pretty fantastic and I absolutely loved it. I haven’t played RE4 for some years and although it was a pretty great game to begin with, they have really brought it up to speed with the modern RE Games and I’d quite like to play 7/8 again. I’d really love a modern remake of RE1. I think it’s the only one that hasn’t had any sort of modern remake so far. 

